import React from "react";

const obj = [
  {
    type: "Salary",
    color: "#f9c74f",
    percent: 45,
  },
  {
    type: "Investment",
    color: "#f9c74f",
    percent: 20,
  },
  {
    type: "Expense",
    color: "#f9c74f",
    percent: 10,
  },
];


export default function Labels() {
  return (
    <>
          {LabelComponent()}
    </>
  );
}

function LabelComponent(){
    return(
        <div className="labels flex justify-between">
            <div className="flex gap-2">
                <div className="w-2 h-2 rounded py-3" style={{background:''}}></div>
            </div>
        </div>
    )
}
